import styles from "./CardCovid.module.css";
 import Card from "../Card";
 import data from "../../utils/constants/indonesia";

function CardCovid() {
    const cardcovid = data.indonesia;
    return(
        <div className={styles.container}>
            <section className={styles.card}>
                <h2 className={styles.card__title}>Indonesia</h2>
                <h3 className={styles.card__subtitle}>Data Covid Berdasarkan Indonesia</h3>
            <div className={styles.card__container}>
                {cardcovid.map(function (card, key) {
                return <Card cardcovid={card} key={key} />;
                })}
                </div> 
            </section>
        </div>
    )
}

export default CardCovid;
